import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open Product Detail Modal by clicking on a product card
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.click('.product-card');

    // Wait for the modal to be visible
    await page.waitForSelector('#productModal', { timeout: 5000 });

    // Take screenshot of the modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_detail_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_detail_modal.png'));

    return {
      success: true,
      action: "Opened Product Detail Modal",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
